    @staticmethod
    def relu(x):
        """ReLU 激活函数"""
        return np.maximum(0, x)

    @staticmethod
    def prelu(x, alpha):
        """PReLU 激活函数（精确实现）"""
        return np.where(x > 0, x, alpha * x)

    @staticmethod
    def batch_norm(x, offset, scale, mean, variance, epsilon):
        """批归一化（推理模式）"""
        x_normalized = (x - mean) / np.sqrt(variance + epsilon)
        return scale * x_normalized + offset

    def forward(self, obs):
        """
        前向传播（精确匹配 MATLAB 网络）
        """
        x = np.array(obs, dtype=np.float32)

        # Layer 1: FC1 (10 → 108)
        x = x @ self.fc1_W.T + self.fc1_b

        # Layer 2: BN1
        x = self.batch_norm(x, self.bn1_offset, self.bn1_scale,
                            self.bn1_mean, self.bn1_var, self.bn1_eps)

        # Layer 3: ReLU
        x = self.relu(x)

        # Layer 4: FC2 (108 → 72)
        x = x @ self.fc2_W.T + self.fc2_b

        # Layer 5: BN2
        x = self.batch_norm(x, self.bn2_offset, self.bn2_scale,
                            self.bn2_mean, self.bn2_var, self.bn2_eps)

        # Layer 6: PReLU
        x = self.prelu(x, self.prelu1_alpha)

        # Layer 7: FC3 (72 → 64)
        x = x @ self.fc3_W.T + self.fc3_b

        # Layer 8: PReLU
        x = self.prelu(x, self.prelu2_alpha)

        # Layer 9: FC4 (64 → 36)
        x = x @ self.fc4_W.T + self.fc4_b

        # Layer 10: ReLU
        x = self.relu(x)

        # Layer 11: FC5 (36 → 16)
        x = x @ self.fc5_W.T + self.fc5_b

        # Layer 12: ReLU
        x = self.relu(x)

        # Layer 13: FC6 (16 → 15) - Q-values
        q_values = x @ self.fc6_W.T + self.fc6_b

        return q_values

    def predict(self, obs):
        """预测最优动作"""
        q_values = self.forward(obs)
        best_action_idx = np.argmax(q_values)
        return float(self.action_space[best_action_idx])

    def get_q_values(self, obs):
        """获取所有Q值"""
        q_values = self.forward(obs)
        return {float(a): float(q) for a, q in zip(self.action_space, q_values)}


